package instagrapi

import (
	"context"
	"net/http"
	"testing"
)

func TestClient_EditProfile(t *testing.T) {
	type fields struct {
		cli              *http.Client
		saveResponseFunc func(ctx context.Context, sessionID string, response *http.Response, opts ...SaveResponseOption) error
	}
	type args struct {
		ctx       context.Context
		fullName  string
		sessionID string
		image     []byte
	}
	tests := []struct {
		name    string
		fields  fields
		args    args
		wantErr bool
	}{
		{
			name: "OK",
			fields: fields{
				cli:              http.DefaultClient,
				saveResponseFunc: saveResponse,
			},
			args: args{
				ctx:       context.Background(),
				fullName:  "asd",
				sessionID: "55964136215:eHuwGXmgNvmGy0:13:AYcLIIktCTn-K3M-2td7odndKfWjdOXVl19IeRR8gw",
				image:     []byte(""),
			},
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			c := &Client{
				cli:              tt.fields.cli,
				saveResponseFunc: tt.fields.saveResponseFunc,
			}
			if err := c.EditProfile(tt.args.ctx, tt.args.fullName, tt.args.sessionID, tt.args.image); (err != nil) != tt.wantErr {
				t.Errorf("EditProfile() error = %v, wantErr %v", err, tt.wantErr)
			}
		})
	}
}
